MainAntiKickButton.MouseButton1Down:connect(function()
local mt = getrawmetatable(game)
local oldmt = mt.index
make_writeable(mt)

mt.index = function(t,i)
   if i == "Kick" then
       return nil
   end
   return oldmt(t,i)
end

local AntiAfkRemote = game:FindService('ReplicatedStorage').Remote:WaitForChild('AntiAfk')
local InputService = game:GetService('UserInputService')
local LastInputTick = tick()

spawn(function()
	while wait(0.5) do
		print(LastInputTick)
		if (tick() - LastInputTick) >= 5 then
			AntiAfkRemote:InvokeServer()
		end
	end
end)

local function onInputEnded(input,gameProcessed)
	LastInputTick = tick()
end

InputService.InputEnded:connect(onInputEnded)
end)

